import React from 'react';
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
import '../css/Tab.css';
import UserGroups from './UserGroups';

const GroupsTabs = () => {
    return (
        <Tabs>
        <TabList>
          <Tab>Your Groups</Tab>
          <Tab>Search Groups</Tab>
        </TabList>

        <TabPanel>
          <UserGroups />
        </TabPanel>
        <TabPanel>
          <h1>All groups here</h1>
        </TabPanel>
      </Tabs>
    )
}

export default GroupsTabs;
